query
  select ?s ?p ?o
  where {graph ?g {
    ?s ?p ?o.
  }}
  limit 10
mapto
  line(?s, ?p, ?o)
end

query
  select ?s
  where {graph ?g {
    ?s a <http://www.openlinksw.com/ontology/acl#AccessMode>.
  }}
  limit 10
mapto
  node(?s);
end

query
  select distinct ?o
  where {graph ?g {
    ?s a ?o.
  }}
  limit 10
mapto
  node(?o).label('qwe').label('asd')
end

query
  select ?s ?t ?am
  where {graph ?g {
    ?s a <http://www.openlinksw.com/ontology/acl#AccessMode>.
    ?s <http://www.w3.org/2000/01/rdf-schema#label> ?t.
    ?s <http://www.openlinksw.com/ontology/acl#hasGrantAccessMode>/<http://www.w3.org/2000/01/rdf-schema#label> ?am.
  }}
  limit 10
mapto
  node(?s).label(?t).color({'Grant Execute': 'yellow', 'Grant Sponge': 'blue'}[?am]);
end
